import React from 'react'
import {slide as Menu} from 'react-burger-menu';

import {Link} from 'react-router-dom'
import {useDispatch,useSelector} from 'react-redux'
import {signOut} from '../../Controllers/Redux/authSlice'


export default ()=>{
    const dispatch = useDispatch();
    const {auth} = useSelector(state=>state)


    function SignOut(){
        dispatch(signOut());
    }

    return (
        <Menu>
        <div className = "sidebar">
            <Link className='nav-link' to="/"><h1 className='brand'>Bug Tracker</h1></Link>
            <ul>
                <li><Link to='/' className='brand'>Dashboard</Link></li>
                <li><Link to='/viewbugs' className='brand'>View Bugs</Link></li>
                {auth.admin &&<li><Link to='/create' className='brand'>Create Bug</Link></li>}
            </ul>
            <button className='nav-link logout' onClick={SignOut}>Logout</button>
        </div>
        </Menu>
    )
}
